function addGlobalStyle(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    head.appendChild(style);
}

const color = 'black'
const colorHover = '#1e1e1e'
const colorActive = '#404040'
const colorActiveFocus = '#4a4a4a'
const outline = '#2f2f2f'



document.addEventListener('keyup', (e) => {
  if (e.code === "KeyR" && !!document.getElementById("top_area_face"
)) document.getElementById("top_area_face").click()
});




